import React from 'react';

const FAQ = () => {
    return (
        <div classNameName='faq' id='faq'>
            <div classNameName="container">
                <h2 classNameName="title h2-text">
                    FAQ
                </h2>
                <div classNameName="inner ">
                    <div className="acordeon">
                        <div className="acordeon-cabecera">Cabecera 1</div>
                        <div classNameName="acordeon-contenido">Lorem ipsum dolor sit amet consectetur adipiscing elit, id nibh nulla enim dis tempor. Eu ultrices interdum vivamus.</div>
                        <div className="acordeon-cabecera">Cabecera 2</div>
                        <div className="acordeon-contenido">Ultrices enim potenti hac proin egestas imperdiet placerat luctus sem sapien et sed, ante conubia malesuada.</div>
                        <div className="acordeon-cabecera">Cabecera 3</div>
                        <div className="acordeon-contenido">Dis tempor blandit convallis morbi dictumst tempus non fermentum, ligula suscipit curabitur tellus at dignissim orci.</div>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default FAQ;
